async function fetchList (list_id,lang) {
    let response = await fetch(`https://survey01.####/lists/`+list_id+'_'+lang+'.json',{cache: "force-cache"});
    var json = await response.json();
    return json;
}


async function addList(inputField) {
    fetchList(inputField.getAttribute("list"),inputField.getAttribute("data-list-lang")).then(options => {
    console.log(options);
    
    var datalist = document.createElement('datalist');
    datalist.id = inputField.getAttribute("list");
    
    datalist.setAttribute("data-list-version",options["meta"]["version"]);
    datalist.setAttribute("data-list-language",options["meta"]["language"]);
    
    options["options"].forEach(function(data) {
        var option = document.createElement('option')
        option.value = data["label"];
        option.setAttribute("data-list-value",data["value"]);
        datalist.appendChild(option)
    });
    

    inputField.parentElement.appendChild(datalist);
    }).catch(function(err) {
        console.log(err);
    });
}

